    <script>
        document.addEventListener('keydown', function(event) {
            switch(event.keyCode) {

                    window.location.href = 'MMC.html';
                    break;

                case 50: // Key '2'

                    break;
                case 51: // Key '3'
                    window.location.href = '../Renko1D/LULU_Renko1D_50.html';

        });
